// SPDX-License-Identifier: MIT

pragma solidity ^0.8.15;



 contract Receiver {


    
    struct ReceiverDetails {
        uint totalFunds;
        uint amount;
        address account ;
    }

    

    
   // mapping (address => uint) deposited;

    function withdrawMoney(uint money) public pure returns(uint){
        ReceiverDetails memory rd ;
        rd.totalFunds = rd.totalFunds - money;
        return money;

    }


    function deposit(uint _amount) internal pure returns(uint){

        ReceiverDetails memory rd ;
        rd.amount = _amount;
        rd.totalFunds += rd.amount;

        return rd.amount;

    }

    

}

